import React from 'react';

const Title = () => {
	return (
		<div>
			<article className="w-80 mw7 h-60 center br3 pa3 pa4-ns mv3 ba shadow-5 b--black-10 about-card">
			  <div className="tc">
			    <h1 className="f3">Jordon Leach</h1>
			    <hr className="mw3 bb bw1 b--black-10"/>
			  </div>
			  <p className="lh-copy measure center f5">Web & Mobile Development</p>
			</article>
		</div>
	)
}

export default Title
